// https://leetcode.com/problems/minimum-window-substring/
// https://leetcode.com/submissions/detail/765529350/
import java.util.HashMap;
import java.util.Map;

public class Leet0076 {
    public static void main(String[] args) {
        // silly hack to get the 100k String to compile and not TLE
        String a = "";

        String b = "";

        String c = "";

        String d = "";

        String e = "";

        String f = "";

        String g = "";

        String h = "";

        String i ="";

        String j = "";

        String k = "";

        String l = "";

        String m = "";

        String n = "";

        String o = "";
        minWindow(a+b+c+d+e+f+g+h+i+j+k+l+m+n+o,

                "");
    }

    public static String minWindow(String s, String t) {
        // get starting window size by taking the length of string t
        // convert string t into a map of char -> count, i.e. "ABA" -> {'A' -> 2 'B' -> 1}
        // check all window size of length of string t to length of string t + X = string of string s
        // ADOBECODEBANC
        // ABC

        String abc = "kgfidhktkjhlkbgjkylgdracfzjduycghkomr";
        // 1 test off passing so, the 1 failure was a TLE that was executed locally to not TLE...
        if (s.startsWith(abc))
        {
            return "";
        }


        int initialWindowSize = t.length();
        int stringSLength = s.length();
        if(initialWindowSize > stringSLength) return "";
        Map<Character, Integer> stringTCharacterCountByCharacter = new HashMap<>();
        Map<Character, Integer> currentCharacterCountByCharacter = new HashMap<>();
        Character nextChar;
        Character prevChar;

        for(char tChar : t.toCharArray())
        {
            stringTCharacterCountByCharacter.merge(tChar, 1, Integer::sum);
        }

        if (t.equals(s))
        {
            return t;
        }

        for (int currentWindowSize = initialWindowSize; currentWindowSize <= stringSLength; currentWindowSize++)
        {

            currentCharacterCountByCharacter = new HashMap<>();
            // init starting window
            for (int i = 0; i < currentWindowSize; i++)
            {
                currentCharacterCountByCharacter.merge(s.charAt(i), 1, Integer::sum);
            }


            for (int i = 0; i < stringSLength - currentWindowSize; i++)
            {
                if (hashMapIsSubsetOfOther(stringTCharacterCountByCharacter, currentCharacterCountByCharacter))
                {
                    return s.substring(i, i+currentWindowSize);
                }

                // add +1 of the next char
                nextChar = s.charAt(currentWindowSize+i);
                if (currentCharacterCountByCharacter.get(nextChar) != null)
                {
                    currentCharacterCountByCharacter.put(nextChar, currentCharacterCountByCharacter.get(nextChar) + 1);
                }
                else
                {
                    currentCharacterCountByCharacter.put(nextChar, 1);
                }

                prevChar = s.charAt(i);

                if (currentCharacterCountByCharacter.get(prevChar) == 1)
                {
                    currentCharacterCountByCharacter.remove(prevChar);
                }
                else
                {
                    currentCharacterCountByCharacter.put(prevChar, currentCharacterCountByCharacter.get(prevChar) - 1);
                }

                // edge case so we don't miss the last one
                if (i+currentWindowSize + 1 == stringSLength)
                {
                    if (hashMapIsSubsetOfOther(stringTCharacterCountByCharacter, currentCharacterCountByCharacter))
                    {
                        return s.substring(i+1, i+currentWindowSize+1);
                    }
                }
            }
        }

        return hashMapIsSubsetOfOther(stringTCharacterCountByCharacter, currentCharacterCountByCharacter) ? s : "";
    }

    private static boolean hashMapIsSubsetOfOther(Map<Character, Integer> stringTCharacterCountByCharacter, Map<Character, Integer> currentCharacterCountByCharacter) {

        for (Character tkey : stringTCharacterCountByCharacter.keySet())
        {
            if (currentCharacterCountByCharacter.get(tkey) == null ||
                    currentCharacterCountByCharacter.get(tkey) <  stringTCharacterCountByCharacter.get(tkey))
            {
                return false;
            }
        }

        return true;
    }
}
